      out.write("\r\n");
      out.write("\t\t\t\t<div class=\"policy-con\">\r\n");
      out.write("\t\t\t\t\t<div class=\"con-title\">\r\n");
      out.write("\t\t\t\t\t\t<h3 class=\"h3-type\">이용약관</h3>\r\n");
      out.write("\t\t\t\t\t</div>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t<div class=\"terms-con\">\r\n");
      out.write("\t\t\t\t\t\t<h4>제1조 (목적)</h4>\r\n");
      out.write("\t\t\t\t\t\t<p>이 약관은 (주)데일리킹 포메인이 홈페이지를 통해 제공하는 각종 정보 서비스(이하 \"서비스\")의 이용조건 및 절차에 관한 사항과<br>\r\n");
      out.write("\t\t\t\t\t\t기타 필요한 사 항을 규정함을 목적으로 합니다.</p>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<h4>제2조 (약관의 효력과 개정)</h4>\r\n");
      out.write("\t\t\t\t\t\t<ul class=\"type02\">\r\n");
      out.write("\t\t\t\t\t\t\t<li>이 약관은 회원등록 시 이용자의 동의와 함께 효력이 발생합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>(주)데일리킹 포메인은 정보 운영의 변경 및 기타 사유로 회원약관을 개정할 수 있으며 개정된 약관은 인터넷서비스 화면에 게재하거나<br>\r\n");
      out.write("\t\t\t\t\t\t\t기타 다른 방법으로 이용자에게 공지함으로써 효력을 발생합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t</ul>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<h4>제3조 (약관외 준칙)</h4>\r\n");
      out.write("\t\t\t\t\t\t<p>이 약관에 명시되지 않은 사항은 관련법령에 규정되어 있는 경우 그 규정에 따릅니다.</p>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<h4>제4조 (용어의 정의)</h4>\r\n");
      out.write("\t\t\t\t\t\t<p>이 약관에서 사용하는 용어의 정의는 다음 각 호와 같습니다.</p>\r\n");
      out.write("\t\t\t\t\t\t<ol>\r\n");
      out.write("\t\t\t\t\t\t\t<li>회원 : 회원서비스의 이용을 신청하고 (주)데일리킹 포메인이 승낙하여 회원ID를 발급받은 자.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>회원ID : 이용자 식별과 서비스이용을 위하여 이용자가 선정하고 (주)데일리킹 포메인가 부여하는 영문자와 숫자의 조합.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>비밀번호 : 이용자와 회원ID가 일치하는 지를 확인하고 통신상의 자신의 비밀번호를 위하여 이용자 자신이 선정한 영문자와 숫자의 조합.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>해지 : (주)데일리킹 포메인 또는 이용자가 서비스 개통 후에 그 이용계약을 종료시키는 의사표시.</li>\r\n");
      out.write("\t\t\t\t\t\t</ol>\r\n");
      out.write("\t\t\t\t\t\t<h4>제5조 (정보서비스 회원등록의 성립)</h4>\r\n");
      out.write("\t\t\t\t\t\t<ul class=\"type02\">\r\n");
      out.write("\t\t\t\t\t\t\t<li>회원등록은 이용자의 이용 신청에 대한 (주)데일리킹 포메인의 이용 승낙과 이용자의 약관내용에 대한 동의로 성립됩니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>회원으로 등록하여 서비스를 이용하고자 하는 자는 (주)데일리킹 포메인에서 요구하는 개인 신상 정보를 제공해야 합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>회원등록 신청을 (주)데일리킹 포메인이 승인한 경우, (주)데일리킹 포메인은 회원 ID와 비밀번호, 정보안내등 필요한 사항을<br>\r\n");
      out.write("\t\t\t\t\t\t\t    회원에게 통지합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>(주)데일리킹 포메인은 다음 각 호에 해당하는 경우 회원등록 신청을 승인하지 않을 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t\t</ul>\r\n");
      out.write("\t\t\t\t\t\t<ol>\r\n");
      out.write("\t\t\t\t\t\t\t<li>다른 사람의 명의를 사용하여 신청하였을 때</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>본인의 실명으로 신청하지 않았을 때</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>회원등록 신청서의 내용을 허위로 기재하였을 때</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>사회의 안녕과 질서 혹은 미풍양속을 저해할 목적으로 신청하였을 때</li>\r\n");
      out.write("\t\t\t\t\t\t</ol>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<h4>제6조 ((주)데일리킹 포메인의 의무)</h4>\r\n");
      out.write("\t\t\t\t\t\t<ul class=\"type02\">\r\n");
      out.write("\t\t\t\t\t\t<li>(주)데일리킹 포메인는 업무상 또는 기술상 특별한 지장이 없는 한 계속적, 안정적(연중무휴,1일 24시간)으로 서비스를 제공할 의무가 있습니다.<br>\r\n");
      out.write("\t\t\t\t\t\t단, 천재지변 및 시스템 정기점검 등 (주)데일리킹 포메인이 필요한 경우, 회원에게 사전 통지한 후, 제한할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t\t<li>(주)데일리킹 포메인은 특별한 사정이 없는 한 회원등록 개시일에 회원이 서비스를 이용할 수있도록 합니다.\r\n");
      out.write("\t\t\t\t\t\t<li>(주)데일리킹 포메인은 회원으로부터 게시판 등에 의해 제기되는 의견에 대해서는 적절한 절차를 거처 처리하며, 처리시 일정 기간이 <br>\r\n");
      out.write("\t\t\t\t\t\t소요될 경우 회원에게 그 사유와 처리 알려주어야 합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t<li>(주)데일리킹 포메인은 회원의 정보를 철저히 보안 유지하며, 양질의 서비스를 운영하거나 개선하는 데에만 사용하고, 이외의 다른<br>\r\n");
      out.write("\t\t\t\t\t\t목적으로 타 기관 및 개인에게 양도하지 않습니다.<br>\r\n");
      out.write("\t\t\t\t\t\t단, 형사상 목적이나 공적인 목적으로 공공기관의 요청이 있는 경우, 특정개인을 식별 할 수 없는 통계자료, 학술연구 등의 목적일 <br>\r\n");
      out.write("\t\t\t\t\t\t때에는 예외로 합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t</ul>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<h4>제7조 (회원의 의무)</h4>\r\n");
      out.write("\t\t\t\t\t\t<ul class=\"type02\">\r\n");
      out.write("\t\t\t\t\t\t\t<li>ID와 비밀번호에 관한 모든 관리의 책임은 회원에게 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>회원은 서비스의 일부로 보내지는 (주)데일리킹 포메인의 전자우편을 받는 것에 동의합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>자신의 ID가 부정하게 사용된 경우, 회원은 반드시 (주)데일리킹 포메인에 그 사실을 통보해야 합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>회원은 이 약관 및 관계 법령에서 규정한 사항을 준수하여야 합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t</ul>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<h4>제8조 (회원등록 해지 및 이용 제한)</h4>\r\n");
      out.write("\t\t\t\t\t\t<ul class=\"type02\">\r\n");
      out.write("\t\t\t\t\t\t\t<li>회원등록을 해지하고자 하는 때에는 회원 본인이 직접 해지하고, 게시판 등에 제기한 본인의 의견 및 답변 등을 제외한 본인의 회원정보를 <br>\r\n");
      out.write("\t\t\t\t\t\t\t삭제할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>(주)데일리킹 포메인은 가입기록과의 일치여부를 확인한 후 회원등록을 자동으로 해지하고, 메일로 통보하며, 한번 해지된 ID는 기존 <br>\r\n");
      out.write("\t\t\t\t\t\t\t사용자라도 사용할 수 없습니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>(주)데일리킹 포메인은 회원이 다음 각 호의 사항에 해당하는 행위를 하였을 경우, 사전 통지 없이 이용 계약을 해지하거나 또는 기간을 <br>\r\n");
      out.write("\t\t\t\t\t\t\t정하여 서비스 이용을 중지할 수 있습니다.\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t\t\t<ol>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>공공 질서 및 미풍 양속에 반하는 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>범죄적 행위에 관련되는 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>국익 또는 사회적 공익을 저해할 목적으로 서비스 이용을 계획 또는 실행할 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>타인의 ID 및 비밀번호를 도용한 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>타인의 명예를 손상시키거나 불이익을 주는 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>같은 사용자가 다른 ID로 이중 등록을 한 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>서비스에 위해를 가하는 등 건전한 이용을 저해하는 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>기타 관련 법령이나 (주)데일리킹 포메인가 정한 이용조건에 위배되는 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t</ol>\r\n");
      out.write("\t\t\t\t\t\t\t</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>(주)데일리킹 포메인은 이용 제한을 하고자 하는 경우에는 그 사유, 일시 및 기간을 정하여 서면 또는 전화 등의 방법을 이용하여 <br>\r\n");
      out.write("\t\t\t\t\t\t\t해당 회원 또는 대리인에게 통지합니다.<br>\r\n");
      out.write("\t\t\t\t\t\t\t단, (주)데일리킹 포메인이 긴급하게 이용을 중지해야 할 필요가 있다고 인정하는 경우에는 위 사항의 과정 없이 서비스 이용을 제한<br>\r\n");
      out.write("\t\t\t\t\t\t\t할 수 있습니다.</li>\r\n");
