      out.write("\t\t\t\t\t\t\t할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>(주)데일리킹 포메인은 이용중지 기간 중에 그 이용중지 사유가 해소된 것이 확인된 경우에 한하여 이용중지 조치를 해제할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t\t</ul>\r\n");
      out.write("\r\n");
