      out.write("\t\t\t\t\t\t<ol>\r\n");
      out.write("\t\t\t\t\t\t\t<li>타인을 비방하거나 중상모략으로 개인 및 단체의 명예를 손상시키는 내용인 경우</li>\r\n");
