      out.write("\t\t\t\t\t\t\t<li>범죄적 행위에 부합된다고 인정되는 내용인 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>타인의 저작권 등 기타의 권리를 침해하는 내용인 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>각 정보의 등록 대상이 아닌 경우</li>\r\n");
